import logo from './logo.svg';
import './App.css';
import Home from './Conatiner/Home/Home';

function App() {
  return (
    <div className="App">
      <div className="App">
        <Switch>
          <Route path="/" component={Home} />
        </Switch>
    </div>
    </div>
  );
}

export default App;
